window.bookSummaryJSON = "<p>The fifth book in the <i>NYT</i> best-selling Expanse series, <i>Nemesis Games</i> drives the crew of the <i>Rocinante</i> apart, and as they struggle to survive, the inner planets fall victim to an enemy's catastrophic plan.</p> <p>A thousand worlds have opened, and the greatest land rush in human history has begun. As wave after wave of colonists leave, the power structures of the old solar system begin to buckle.</p> <p>Ships are disappearing without a trace. Private armies are being secretly formed. The sole remaining protomolecule sample is stolen. Terrorist attacks previously considered impossible bring the inner planets to their knees. The sins of the past are returning to exact a terrible price.</p> <p>And as a new human order is struggling to be born in blood and fire, James Holden and the crew of the<i> Rocinante</i> must struggle to survive and get back to the only home they have left.</p> <p><i>Nemesis Games </i>is a breakneck science fiction adventure following the bestselling <i>Cibola Burn</i>.<br> &nbsp;</p> <p><b>The Expanse</b></p> <ul> <li><i>Leviathan Wakes</i></li> <li><i>Caliban's War</i></li> <li><i>Abaddon's Gate</i></li> <li><i>Cibola Burn</i></li> <li><i>Nemesis Games</i></li> <li><i>Babylon's Ashes</i></li> <li><i>Persepolis Rising</i></li> <li><i>Tiamat's Wrath</i></li> <li><i>â€‹Leviathan Falls</i></li> <li><i>Memory's Legion</i>&nbsp;</li> </ul> <p><b>The Expanse Short Fiction</b></p> <ul> <li><i>Drive</i></li> <li><i>The Butcher of Anderson Station</i></li> <li><i>Gods of Risk</i></li> <li><i>The Churn</i></li> <li><i>The Vital Abyss</i></li> <li><i>Strange Dogs</i></li> <li><i>Auberon</i></li> <li><i>Memory's Legion</i></li> </ul>"; 
